INSERT INTO `about_us` (`id`, `description`) VALUES
(1, 'من نحن\r\n\r\n\r\nإطلاق موقع مواعيد طبيةهي نقلة نوعية في عالم التكنلوجيا تهدف إلى تسهيل الوصول إلى المكان المخصص والذي تبحث عنه [ مستشفى–مجمع–مركز–عيادة ] أو حتى طبيب معين .. وذلك حتى يكون هذا الأمر أسهل من ذي قبل تكون كل هذا الأمور في مكان واحد تجتمع فيه المستشفيات والأطباء المتخصصين في كل دولة من دول العالم العربي حاليا فقط. أنه موقع مواعيد طبية\r\n\r\nحالياً موقعنا مواعيد طبيةسوف يقوم بتغطية كافة الدول العربية تدريجيا وسنصل إلى أكبر شريحة من المستفيدين والراغبين في الوصول إلى أي مستوصف طبي أو طبيب معين أو حتى إختصاص بعينه يمكنهم الأن ذلك.\r\n\r\nبالمعنىالأخرى، موقع مواعيد طبيةسيكون مستشفى صغيرولكن بإمكانيات كبيرة يمكنكم الإستفادة منه وإختصار الجهد والوقت والمال.\r\n\r\nمعلومات عن موقع مواعيد طبية\r\n\r\no	يمكنك الحجز موعد في أي مستوصف طبي سواء كان [ مستشفى–مجمع–مركز–عيادة ].\r\n\r\no	يمكنك إختيار الدولة التي أنت بها أو التي تنوي السفر إليها وإختيار المستوصف أو الطبيب الذي ترغب بالعلاج به.\r\n\r\no	سوف يقوم المستوصف أو الطبيب بالإتصال بك بعد حجز الموعد وتحديد التاريخ لتأكيد الموعد أو تعديله إلى تاريخ أنسب لك.\r\n\r\no	يمكنك أيضا عبر موقعنا مواعيد طبيةأن تقوم بطلب طبيب خاص يصلك إلى البيت وكأنك بالمستوصف يقدم لك العلاج المناسب وأنت في بيتك.\r\n\r\nلماذا مواعيد طبية؟\r\n\r\nإن موقع مواعيد طبيةيقوم بالتسهيل والتبسيط وأن تتواصل مع المستوصف أو الطبيب بشكل مباشر لتوفير الخدمة التي ترغب بها دون الحاجة إلى الإتصال فقط عن طريق موقعنا أو أحد تطبيقاتنا على الأيفون / الإندرويد. ومن بين الأمور التي يمكنك القيام بها هي :\r\n\r\no	إمكانية الإختيار دولة التي يوجد بها الــ [ مستشفى –مجمع –مركز –عيادة ].\r\n\r\no	إمكانية الإختيار الطبيب بحسب التخصص [القلب–الأذنوالحنجرة–العقموالإخصاب–الباطنية–المسالكالبولية–الجلدوالتجميلغيرها الكثير من التخصصات]\r\n\r\no	سهولة إستخدام الموقع والتطبيق لتسجيل العضوية وتفعيها والتنقل لرؤية كامل التفاصيل.\r\n\r\no	الدقة و السرعة بإختيار الدولة والمستوصف وتخصص الطبيب الذي ترغب بالعلاج لديه.\r\n\r\no	طلبك سيكون محدداً ومفهوم ولا يوجد به أي لبس بناء على الخيارات المُتاحة بالتطبيق وموقع مواعيد طبيةفهذه أفضل طريقة للوصول إلى مبتغاك.\r\n\r\no	تقديم خدمة طبيب الأسرة والذي سيكون طبيبك الخاص دون الخروج من البيت ومعاناة الوصول إلى المستوصف سيكون أختيارك لأقرب طبيب يكون في منطقتك التي تقع بها.\r\n\r\no	إمكانية مراجعة حجوزات السابقة والتي قمت بها في أي دولة أو مستوصف أو مع أي طبيب.\r\n\r\no	الحصول على العروض التي يقدمها الــ [ مستشفى–مجمع–مركز–عيادة ] في أي من تخصصاتهم والإستفاده منها.');
