INSERT INTO `rules` (`id`, `description`) VALUES
(1, 'الشروط والأحكام\n\nأولا :عند تسجيلك على موقعمواعيد طبيةفأنك تُقر وتلتزم بأحكام اتفاقية مستخدم لموقع مواعيد طبيةالمُبينه أدناه.\n\nثانيا : عند دخولك إلى الموقع مواعيد طبية وتفعيل أسم المستخدم الخاص بك فأنك مسؤول مسؤولية كامله عن كل الأعمال التي تقوم بها على الموقع من نشر أو توصية أو تقييم أو حتى الإخبار عنا. وإذا كنت لا ترغب بذلك لا يحق لك أن تصبح عضوا وتملك حساب مستخدم على موقع مواعيد طبية.\n\nثالثا : الخدمة التي يقدمها موقع مواعيد طبيةهي تسهيل الحجوزات الطبية على الإنترنت خدمة للمراجعين والمستفيدين وخدمة للمؤسسات الصحية الخاصة.\n\nرابعا : موقع مواعيد طبية لا يتدخل بأي شكل من الأشكال في تقديم خدمة طبية أو تقديم أو تأخير موعد طبي في أي مؤسسة صحية أيا كانت هذه المؤسسة وفي أي بلد كان المستفيد ومقدم الخدمة الصحية. المؤسسة الصحية هي المسؤولة عن ترتيب وتوفير الخدمة الصحية للمراجع المستخدم لموقع مواعيد طبيةولكل دولة قانون يُخضع المؤسسات الصحية بالأنظمة واللوائح هي مسؤوله عن أي شكوى مقدمة.\n\nخامسا : على المستفيد من موقع مواعيد طبيةأن يعي أن أي خدمة مقدمة من أي مؤسسة صحية مسجلة لدينا بالموقع الإلكتروني أو التطبيق مسؤولة مسؤولية كاملة عن التزامها بأنظمة وقوانين الدولة فيما يخص الخدمات الصحية التابعة للوزارة المعنية.\n\nسادسا : لا يضمن موقع مواعيد طبيةأي خدمة صحية مقدمة للمراجع أو المستفيد من ناحية الجودة والكفاءة وأن ما تقدمة المؤسسة الصحية ليس شرطا ً أن تجده مطابقا تماما في داخل المؤسسة الصحية وهي المسؤولة عن أي تقصير أو إعلان مُضلل يخالف الواقع.\n\nسابعا : بعض المؤسسات الصحية ستقوم بوضع خدماتها الصحية في أي مجال من مجالاتها أو تخصصاتها المختلفة دخل المؤسسة ومن هنا نبين لكم أن موقع مواعيد طبيةلا يتحقق من ذلك على النحو المستقل من كل مؤسسة صحية وهي المسؤولة مسؤولية كاملة عن ذلك.\n\nثامنا : أن موقع مواعيد طبيةغير مسؤول عن أي مؤسسة صحية لا تلتزم بالشروط والقوانين الصحية التابعة لدولتهم وأي شكوى مكررة ورسمية على أي مؤسسة صحية مسجلة لدينا سيتم حذفها دون الرجوع إليهم ودون تحمل موقع مواعيد طبيةأي تبعات قانونية أو مالية على هذا الإلغاء.\n\nتاسعا : على المراجع والمستفيد من أي خدمات صحية تقدمها أي مؤسسة التأكد التام عن الخدمات التي يقدمونها بالاستفسارات الشخصية وبالتعليقات التي ستوجد في صفحة أي مؤسسة أو طبيب .\n\nعاشرا : إسم المستخدم وكلمة السر على موقع مواعيد طبيةيقوم المشترك نفسه باختيارها ولا يمنح إسم مستخدم مكرر لأي شخصا ً كان أي بمعنى أنك يمكنك الدخول بأي وقت بالعضوية التي سجلتها معنا وكلمة السر التي ستُرسل على الإيميل لمشتركي الإيميل . لذا وجب التنويه أن أي تعليق أو استخدام للموقع من أي شخص سيكون مسؤول مسؤولية تامه عن ما يحدث خلال فترة تسجيله ويحق لنا اللجوء إلى القضاء بأي دولة من الدول أو حتى التغاضي إذا ما أُسيء استخدام موقع مواعيد طبية.\n\nحادي عشر : أنت تضمن أنه أي معلومة مسجلة من قبلك تكون معلومات صحيحة 100% ولا تنتحل أي شخصية من الشخصيات حول العالم داخل موقع مواعيد طبيةأكان عضو مستفيد أو مؤسسة صحية أو طبيب.\n\nثاني عشر : موقع مواعيد طبيةيتعهد بسرية المعلومات المسجلة لديه مسؤولية كاملة ولن يتم عرضها على أي شخص إلا أن تكون حجزت موعدا في أي مؤسسة صحية وأعطيتهم تفاصيلك [رقم الهاتف –الإسم –الإيميل –تاريخ الميلاد] وغيرها من التفاصيل الشخصية. أو المواد أو التعليقات التي تقوم أنت بنشرها وإرسالها على موقع مواعيد طبيةسوف لن تكون شخصية أو سرية ولن يكون لنا أي التزام قانوني في هذه المواد المرسلة سواء كانت كتابية أو صور أو حتى فيديوهات.\n\nثالث عشر : لا يحق لأي شخص من الأشخاص المسجلين معنا أو غير المسجلين بإستخدام موقع مواعيد طبيةلغرض ينافي عن الخدمة التي يوفرها.\n\nرابع عشر : موقع مواعيد طبيةلا يبيع هذا الخدمة إلا عن طريق من خولهم وأخذوا صفة مروج تجاري وأي صفة أخرى نحن لسنا مسؤولين عنها إطلاقا ويتحمل المروج الغير مصرح والمستفيد المسؤولية عن أي ضرر يقع جراء ذلك ويحق لنا إتخاذ الإجراء القانوني المناسب حيل ذلك . ولدى موقع مواعيد طبيةالحق بالملاحقة القانونية والإستعانية بأي جهة من الجهات الحكومية أو المُخولة الخاصة لمن ألحقوا الضرر بنا.\n\nخامس عشر : اللجوء أو القيام باي أعمال غير مصرحة قانونا ومنها جمع أسماء وإيميلات وأرقام مشتركينا لغرض نشرها تجاريا بأي وسيلة من الوسائل الإلكترونية يحق لنا إتخاذ الإجراءات القانونية لملاحقة من عبث بذلك.\n\nسادس عشر : أي معلومات تخص موقع مواعيد طبيةمن أرقام هواتف أو فاكس أو أيميل أو صفحات التواصل الإجتماعي أو موقع إلكتروني أو تطبيق للهواتف النقالة لا يحق لأي شخص الإستفادة منها إطلاقا لغرض الترويج أو التشهير أو أي أمر أخر يُعد مخالف بأي دولة من الدول. ويحق في حال الإتفاق بيننا وبين أي مؤسسة أو شخصية إعتباريه.\n\nسابع عشر : موقع مواعيد طبيةسيقوم بتعديل أسعار الخدمات المقدمة من المؤسسة الصحية أو الطبيب الخاص وذلك بناء على التعديلها من قبلهم ولا دخل لموقع مواعيد طبيةبتحديد سعر أي خدمة من الخدمات المقدمة من المؤسسة الصحية.\n\nثامنة عشر : سيكون موقع مواعيد طبيةفي بعض الأوقات التي يحتاج فيها الموقع للصيانة مقفل لذا لا تتحمل إدارة موقع مواعيد طبيةأي مسؤولية عن ذلك الإنقطاع والهدف من ذلك هو أعمال الصيانة لا ضياع الخدمات المقدمة.\n\nتاسع عشر : سيسمح موقع مواعيد طبيةبنشر التعليقات لتقييم أي طبيب أو أي مؤسسة صحية وذلك وفق معايير محددة وهي [عدم التهجم-عدم السب والشتم-عدم نشر أي كلمات مخلة-عدم نشر أي كلمات عنصرية] إذا كان الهدف هو تقييم الخدمة فلا بد من تقييمها بطريقة مهذبة ونقد بناء لأجل مصلحة المستفيدين الأخرين. أي تعليقات ستكون بها أي تجاوزات سيتم حذفها دون سابق إنذار ولا نتحمل أي مسؤولية أتجاهه. ولا يُسمح لأي مؤسسة بتقييم مؤسسة أخرى وسيكون حكمها كحكم التعليقات المخالفة.\n\nعشرين : يحق لموقع مواعيد طبيةالتصرف بأي تعليقات داخل الموقع أو التطبيقات تراها مناسبة بإعادة النشر أو الترجمة أو غيرها من طرق الإستفادة.\n\nواحد وعشرين : عند رغبة المؤسسات الصحية أو الأطباء الخاصين الحصول على عضوية أو واجهتهم أي عقبات أثناء التسجيل يمكنهم مراسلتنا مباشرة علىLIVE CHATأو بالمراسلة على الإيميل الرسمي المعتمد.\n\nإثنان وعشرين : عند تأكيد الرغبة بحجز موعد عن طريق موقع مواعيد طبيةبينك وبين أي مؤسسة صحية في أي بلد يتم الإتفاق بينكم بالتراضي على المبلغ المتفق عليه يتم الدفع من خلال المستفيد لدى وصوله إلى المؤسسة الصحية لحضور موعده الطبي. علما أن موقع مواعيد طبيةلا دخل له بهذا الإتفاق ولا يتقاضي أي عمولة على حساب أي عميل . الإتفاق بينه وبين تلك المؤسسة الصحية لرغبتها بعرض خدماتها للناس.\n\nثلاثة وعشرين : في حالة كان العميل قد أخطأ في إختيار الطبيب المعالج عن طريق موقع مواعيد طبية وعند وصوله تبين له ذلك يحق له إلغاء الموعد أو الرضى بتغيير الموعد بناء على حاجته التي دعته لذلك وعليه في حالة زيادة السعر الإلتزام بالدفع لتلك المؤسسة.\n\nأربعة وعشرين : ببداية التعامل بين المستفيد من الخدمة –المراجع – وبين المؤسسة الصحية ماليا يكون موقع مواعيد طبيةلا دخل له في أي تعاملات مالية ينتج عنها أي ضرر للمستفيد أو للمؤسسة ويجب عليهما الإتفاق وتسوية الأمر بينهما سواء تلك المبالغ المالية التي دفعها نقدا ً أو التي دفعت بالبطاقة الإئتمانية.\n\nخمسة وعشرين : يقع على عاتق المؤسسة الصحية المسؤولية الكاملة في حالة الإتفاق بينها وبين موقع مواعيد طبيةبإعطاءنا البيانات الرسمية الدقيقة للمؤسسة وللأطباء العاملين داخل المؤسسة وتخصصاتهم الصادرة من الجهات ذات الإختصاص ولا يتحمل موقع مواعيد طبيةإي خطأ مقصود أو متعمد في هذا الإطار وعلى المستفيد في حالة حجزه ووصوله تبين له خلاف ما تم نشرة أن يتبع الطرق القانونية في بلده ولا يكون موقع مواعيد طبيةطرف في هذا النِزاع بأي حال من الأحوال.\n\nستةوعشرين : على أي جهة كانت أو أي شخصية إعتبارية أرادت نشر موقع مواعيد طبيةأو نشر التطبيقات الخاصة بالهواتف الذكية أو حتى مواقع التواصل الإجتماعي الخاصة بالموقعفي أي وسيلة كانت دون المساس أو التغيير أو الحذف أو التلاعب بقصد الإساءة في المحتوى أو الشعار نسمح بذلك ولا نسمح بخلافه.\n\nسبعة وعشرين : إن هذا الشروط والأحكام تنطبق كليا على موقع مواعيد طبيةوتطبيقه المنشور على الهواتف الذكية حاليا [الإيفون IOS- والإندرويد] وعلى مواقع التواصل الإجتماعي حاليا [الفيسبوك –تويتر –الإنستجرام –قناة التيلجرام] والتي تنشر روابطها بالموقع الإلكتروني الرسمي التابع لنا.');
